export type Repo = {
    name: string;
    description: string | null;
    language: string;
    forks_count: number;
    stargazers_count: number;
    created_at: string;
    updated_at: string;
  };

export type User = {
    login:string;
    html_url:string;
    name:string | null;
    company:string | null;
    location:string | null;
    bio:string | null;
    public_repos:number;
    followers:number;
    following:number;
    created_at:string;
    updated_at:string;
    email: string | null;
    hireable: boolean | null;
  }
